export default (function(a,b,c,d,e,f){return {data:{rh3SrYt4Kn:{data:{id:1212,attributes:{imdbId:"tt0356634",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTIzMTc1OTUxOV5BMl5BanBnXkFtZTYwNTMxODc3._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.1\u002F10"},{Source:"Rotten Tomatoes",Value:"15%"},{Source:"Metacritic",Value:"27\u002F100"}],item_lang:{data:{id:1875,attributes:{title:"Garfield",plot:"Garfield (Bill Murray), the fat, lazy, lasagna lover, has everything a cat could want. But when Jon Arbuckle (Breckin Meyer), in an effort to impress veterinarian and old high-school crush Liz (Jennifer Love Hewitt), adopts a dog named Odie and brings him home, Garfield gets the one thing he doesn't want. Competition. One night, Odie runs away and gets dog-napped after Garfield locks him outside. Garfield, in an out of character move, goes to search for and rescue Odie with the help of a variety of animal friends along the way.",slug:"garfield"}}},books:{data:[{id:6714,attributes:{title:"The Art of Jim Davis' Garfield",description:"This monograph will feature original production art from the comic strip, original cels from the television show, rare production and publishing art, and more! Garfield waddled onto the comics page in 1978, and the corpulent cat is still going strong today! If you ve ever wanted to see a behind-the-scenes look at the production art, or wanted to read more about the man behind the cat, this is your book! The Art of Jim Davis Garfield will go through the artistic process from the very beginning of the strip, to all of the media that it produces today, in details that fans have never seen before. If you love Garfield, this is definitely the book for you! For new and old fans alike, this book is truly a treasure and offers a rare behind-the-scenes look at the production of the comic strip and the creation of America s favorite lasagna-loving fat cat. Featuring an original essay by noted historian R. C. Harvey, this art book will take you through the history of Jim Davis and Garfield, and how the furry feline has grown in popularity and style over the years. It discusses many of the mediums Garfield is represented in, from the Garfield and Friends television show to the live-action movies, to the current animated series, to comic books and beyond! In the essay, Harvey interviews Davis about the history of Garfield, from inception to the modern version of this Monday-hating tabby. Davis gives the inside scoop on how Garfield s story unfolded, and how the cat was shaped into the lovable character the world knows today. \"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=h1IAkAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"RC Harvey"],firstBook:true,published:"2016-08-30",publisher:"Hermes Press",subtitle:d}},{id:6715,attributes:{title:"Garfield Original Graphic Novel: The Thing in the Fridge",description:"Davis' legendary creation returns to comics with three all new short stories, including contributions by star writer Evanier (Garfield & Friends). 6 x 9.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aUM7DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e,b,a],firstBook:c,published:"2017-10-31",publisher:f,subtitle:d}},{id:6716,attributes:{title:"Garfield's Big Fat Hairy Adventure",description:"Garfield, the lasagna-loving cat, Odie the dog, and their owner Jon have a series of adventures, where they enter a talent competition, encounter a child genius, and horrifically eat a vegetarian lasagna.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uK4yDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e,b,a],firstBook:c,published:"2016-10-25",publisher:f,subtitle:d}},{id:6717,attributes:{title:"Garfield & Co. #6",description:"Hunting birds is something Garfield's never had any interest in. But when he finds a nest full of abandoned eggs, Garfield puts his feline pride aside and decides to help them hatch. Harry, the stray cat from down the block, would love to put the newborn birds right on his dinner menu. As soon as they hatch, the birds assume Garfield is their mother and start following him around everywhere! Garfield can't take naps any more, and his water bowl has been turned into a bird bath. Is Garfield stuck being the birds' mom forever? Also featuring the stories \"Curse of the Were-dog\" and \"Little Yellow Riding Hood.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kVcTAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,b,"Cedric Michiels"],firstBook:c,published:"2013-09-10",publisher:"Papercutz",subtitle:"Mother Garfield"}},{id:6718,attributes:{title:"Garfield Original Graphic Novel",description:"Sucked into an ultimate 3-D television, Garfield and Odie are sent on a reality-bending adventure.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0q4yDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e,b,a],firstBook:c,published:"2017-06-06",publisher:f,subtitle:"Unreality TV"}}]}}},meta:{}}},prerenderedAt:1680940975234}}("Jim Davis","Mark Evanier",null,"","Scott Nickel","Simon and Schuster"))